import React, { Component } from "react";
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBFormInline, MDBDropdown, MDBDropdownToggle, MDBDropdownMenu,  MDBDropdownItem, MDBContainer, MDBIcon } from "mdbreact";
// import DocsLink from "./../components/docsLink";

class NavbarPage extends Component {
  state = {
    collapseID: ""
  };

  toggleCollapse = collapseID => () =>
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));

  render() {
    return(
        <MDBNavbar id="Totalhome"
            color="bg-danger"
            style={{ Bacgroundcolor: "blue" }}
            dark
            expand="md"
            scrolling
          >

            <MDBNavbarBrand>
              <img src="../images/logo.png" id="logo-header" alt="imagelogo" />
              <strong className="white-text">ExtrActu</strong>
            </MDBNavbarBrand>
            <MDBNavbarToggler
              onClick={this.toggleCollapse("navbarCollapse")}
            />
            <MDBCollapse
              id="navbarCollapse"
              isOpen={this.state.collapseID}
              navbar
            >
              <MDBNavbarNav left>
                <MDBNavItem active>
                  <MDBNavLink to="#!" className="accueil">Accueil</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem active>
                  <MDBNavLink to="#!" className="accueil">Categorie</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem active>
                  <MDBNavLink to="#!" className="accueil">Prevention</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem active>
                  <MDBNavLink exact={this.forceUpdate} to="/" className="accueil">Medicament</MDBNavLink>
                </MDBNavItem>
              </MDBNavbarNav>
              <MDBNavbarNav right>
                <MDBNavItem active>
                  <MDBNavLink to="/login" className="accueil">Login</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem active>
                  <MDBNavLink to="/register" className="accueil">Register</MDBNavLink>
                </MDBNavItem>
              </MDBNavbarNav>
            </MDBCollapse>

          </MDBNavbar>
    )

    }

    };

export default NavbarPage;
